import React from 'react';
import Graphfarmer from "./page-com/graphfarmer";

const Milk = () => {
    const divStyle = {
        color: '#082459',
        fontSize: '24px',
        fontFamily: 'Roboto',
        fontWeight: 700,
        wordWrap: 'break-word'
    };
    const divSmall = {
        color: '#082459',
        fontSize: '20px',
        fontFamily: 'Roboto',
        fontWeight: '700',
        wordWrap: 'break-word'
    }

    return (
        <div style={{ margin: '16px' }}>
            <div style={divStyle}>
                กราฟแสดงปริมาณนมต่อวัน
            </div>
            <Graphfarmer />
            <div style={{ width: '100%', height: '100%', background: 'EDEDED', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: '8px' }}>
                <div style={{marginLeft: '12px',marginTop}}>
                    <div style={divStyle}>
                    รายการล่าสุด
                    </div>
                    <div style={divSmall}>
                        23 Nov 2023
                        <div style={{width: '100%', height: '100%', background: '#D9D9D9'}}>
                            <div> ปริมาณนมวัว</div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Milk;
